import React from 'react';
import './App.css';
import HomePage from './pages/homepage/homepage.component';
import { BrowserRouter } from 'react-router-dom';

const HatsPage = () => (
	<div className="">
		<h1>HATS PAGE</h1>
	</div>
);
function App() {
	return (
		<div className="">
			<Route path="/hats" component={HatsPage} />
			<Route exact path="/" component={HomePage} />
		</div>
	);
}

export default App;
